import React from 'react';

const Cards = ({ results }) => {

    let display;
    console.log(results);
    if (results) {
        display = results.map((x) => {
            let {id, name }=x;
            return (<div key={id} className='col-4'>{name}</div>)
        })
    }
    else {
        display = "0 Character Found";
    }




    return (
        <>
            {display}
        </>
    )
}

export default Cards
